[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "nando"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "PREFIX owl: <http://www.w3.org/2002/07/owl#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX nando: <http://nanbyodata.jp/ontology/NANDO_>

SELECT (COUNT(DISTINCT ?disease) as ?disease_count)
FROM <http://nanbyodata.jp/ontology/nando>
WHERE {
  ?disease a owl:Class ;
           rdfs:subClassOf nando:1100001 .
}"}}]

[{"name": "mcp__togomcp__get_sparql_example", "input": {"dbname": "pdb"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "pdb"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "pdb", "sparql_query": "PREFIX pdbx: <http://rdf.wwpdb.org/schema/pdbx-v50.owl#>

SELECT ?method (COUNT(DISTINCT ?entry) as ?count)
FROM <http://rdfportal.org/dataset/pdbj>
WHERE {
  ?entry a pdbx:datablock ;
         pdbx:has_exptlCategory/pdbx:has_exptl ?exptl .
  ?exptl pdbx:exptl.method ?method .
}
GROUP BY ?method
ORDER BY DESC(?count)"}}]
